Talion (2007) [DVDRip]

Sophie Evans, Sara May, Lesly Kiss, Dunia Montenegro, Monica Vera, Salma Denora

What do you do when someone close to you turns up dead? A young life was taken due to the dark world of organized crime where they don't value the lives of the girls they fuck.
The sister of the deceased takes the law into her own hands and avenges her sister's death. She enters the dark underground world where uses her body and mind to allow her sister's soul to rest in peace.

